        function dropDown(param) {
            this.doc = document;
            this.target = this.doc.querySelector(param.target);
            this.bodyContent = this.doc.querySelector(param.body);
            this.dropDown = this.target.querySelectorAll("ul.sg-nav .dropDown");
            this.sgNavLi = this.target.querySelectorAll("ul.sg-nav li");
            this.dropDownMenu = this.target.querySelectorAll(".dropDown-menu");
            this.sgMemberJoin = this.target.querySelector(param.exception);
        }

        dropDown.prototype.init = function () {
            var _this = this;

            [].forEach.call(this.sgNavLi, function (item, index) {
            item.addEventListener("mouseover", function () {
                if (item.classList.contains("sg-login__memberJoin") == false) {
                    _.map(_this.dropDownMenu, function (v) {
                        v.style.display = "none";
                    });
                }
            });
        });
    }

    dropDown.prototype.exception = function () {
        var _this = this;

        if (this.sgMemberJoin) {
            this.sgMemberJoin.addEventListener("mouseover", function () {
                _.map(_this.dropDownMenu, function (v) {
                    v.style.display = "none";
                });
            });
        }
    }

    dropDown.prototype.handleBodyEvent = function (index) {
        var _this = this;

        _this.bodyContent.addEventListener("mouseover", function () {
            _this.dropDownMenu[index].style.display = "none";
        });
    }

    dropDown.prototype.dropDownEvent = function (index) {
        var _this = this;

        this.dropDown[index].addEventListener("mouseover", function () {
            _.map(_this.dropDownMenu, function (v) {
                v.style.display = "none";
            });
            _this.dropDownMenu[index].style.display = "block";
        });
    }

    dropDown.prototype.handleEvent = function () {
        var _this = this;

            [].forEach.call(this.dropDown, function (item, index) {
                _this.dropDownEvent(index);

                _this.handleBodyEvent(index);
            });
        }

        dropDown.prototype.handleAction = function () {
        this.init();
        this.exception();
        this.handleEvent();
    }

    var DropDown = new dropDown({
            target: ".sg-header",
        body: ".body-content",
        exception: ".sg-login"
        });

        DropDown.handleAction();

    </script>



    
